CommentBody:
On Escalation Ticket # 00421750 the new comment has been added: Robert-Zoltan Sumi:

@WaitingOnEngineer As we agreed please ask if they can reproduce the issue with applications other than WhatsApp. Because we were unable to reproduce the issue, please also ask for more details how to reproduce it. For example, currently the first instruction is: "Updated the EPP client and waited 30 seconds to reflect changes. Application still working", but what had they do before this on the server? What does "Application still working" mean? They managed to start it when it was in the deny list, or it was started from the beginning and they thought that epp-client will close it (which we do not do)?.The attached recording does not show any server setting, just the user refreshing epp-client and clicking on The WhatsApp icon.

